import numpy as np
import pandas as pd
import tensorflow as tf
import matplotlib.pyplot as plt
import tensorflow_hub as hub

df = pd.read_csv('wine.csv', usecols = ['country', 'description', 'points', 'price', 'variety', 'winery'])
df.dropna(subset = ['description', 'points'])

df.head(5)

df['label'] = (df.points >= 90).astype(int)
df = df[['description', 'label']]
df.head()

train, val, test = np.split(df.sample(frac=1), [int(len(df)*0.8), int(len(df)*0.9)]) #frac means the rows that picked, 2 nums are the seperation points
print(len(train), len(test), len(val), len(df)) #103976 12998 12997 129971 // %80 %10 %10 %100

def df_to_dataset(dataframe, shuffle= True, batch_size= 1024): #creates a tensor array
    df = dataframe.copy()
    labels = df.pop('label')
    df = df['description']
    ds = tf.data.Dataset.from_tensor_slices((df, labels)) # Tensor akışını oluştur, her bir öğe (description, label) çiftini içerir
    if shuffle:
        ds = ds.shuffle(buffer_size = len(dataframe))
    ds = ds.batch(batch_size)
    ds = ds.prefetch(tf.data.AUTOTUNE) # Veriyi önceden yükle (prefetch), performans artışı sağlar
    return ds

train_data = df_to_dataset(train)
valid_data = df_to_dataset(val)
test_data = df_to_dataset(test)

embedding = "https://tfhub.dev/google/nnlm-en-dim50/2" #readytouse word --> num embedding program
hub_layer = hub.KerasLayer(embedding, dtype=tf.string, trainable=True) #makes a layer for ready converter
hub_layer(list(train_data)[0][0])

model = tf.keras.Sequential()
model.add(hub_layer)
model.add(tf.keras.layers.Dense(16, activation='relu'))
model.add(tf.keras.layers.Dropout(0.4))
model.add(tf.keras.layers.Dense(16, activation='relu'))
model.add(tf.keras.layers.Dropout(0.4))
model.add(tf.keras.layers.Dense(1, activation='sigmoid'))

model.compile(optimizer=tf.keras.optimizers.Adam(learning_rate=0.001),
              loss=tf.keras.losses.BinaryCrossentropy(),
              metrics=['accuracy'])

history = model.fit(train_data, epochs=10, validation_data=valid_data)

plt.plot(history.history['accuracy'], label ='Training Acc')
plt.plot(history.history['val_accuracy'], label = 'Validation Acc')
plt.title('Accuracy of Model')
plt.xlabel('Epoch')
plt.ylabel('Accuracy')
plt.legend()
plt.show()

